import React from "react";
import "./App.css";
import Details from "./components/Details";
import list from "./list.js";

class App extends React.Component {
  render() {
    return (
      <div className="container">
        <div>Hello World!</div>
        list.filter((book) => {<Details book={this.book} />})
      </div>
    );
  }
}

export default App;
